import {
  IonCard,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
} from "@ionic/react";
import React, { ReactComponentElement } from "react";

const Card: React.FC<{id: string, title: string, subtitle: string}> = (props) => {
    var id = props.id;
  return (
    <IonCard button={true}>
      <IonCardHeader>
        <IonCardTitle>{props.title}</IonCardTitle>
        <IonCardSubtitle>{props.subtitle}</IonCardSubtitle>
      </IonCardHeader>
    </IonCard>
  );
};

export default Card;
